会議や講義、イベントなどで手軽に使えるワイヤレスマイク付き拡声器スピーカー<img src='https://image.rakuten.co.jp/tokka-com/cabinet/tokka_zaiko.gif' border='0' alt='送料・在庫状況を確認する'><br><font color="#ff0000"><b>↑↑↑正確な在庫状況は上記バナー「送料・在庫状況を確認する」をクリックして頂き、必ずご確認ください。</b></font><br><br><table border="0" cellspacing="0" cellpadding="0" width="100%"><tr><td width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/tlt_option.jpg" border="0" width="100%"></td></tr><tr><td width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td></tr><tr><td><font color="red">長期保証をご希望のお客様は下記の表より「商品＋長期保証」のページへ移動してご注文ください。<br>※長期保証は法人加入や業務使用、譲渡や再販はご利用いただけません。<br>長期保証についてＰＣ・タブレット・プリンター・工具はメーカー保証を含めて３年、家電は５年間の保証となります。</font></td></tr><tr><td width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr></table><table border="0" cellspacing="0" cellpadding="0" width="100%"><tr><td width="15%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/btn_option01.jpg" border="0" width="100%"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="15%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/btn_option02.jpg" border="0" width="100%"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="15%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="15%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="15%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="15%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td></tr><tr><td colspan="11" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr></table><table border="0" cellspacing="0" cellpadding="0" width="100%"><tr><td colspan="7" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/tlt_service.jpg" width="100%"></td></tr><tr><td colspan="7" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr><tr><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/btn_service01.jpg" width="100%"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="2%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td><td width="23%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="10"></td></tr><tr><td colspan="7" width="100%"><img src="https://www.rakuten.ne.jp/gold/tokka-com/img/img_guide/spacer.gif" width="100%" height="20"></td></tr></table><br>■スピーカー部<br>■講義や講演、小規模な会議場やイベントなどに手軽に持ち込み、簡単にセッティングができる拡声器スピーカーとマイクのセットです<br>■ワイヤレスマイクが1本同梱されており自由に移動しながらの使用が可能です<br>■ワイヤレスマイクはB型帯域に割り当てられた10波の中から1波を選択して利用できますので周波数が重なった場合も手軽に変更が可能です<br>■有線マイク入力端子も2系統搭載しており、サンワサプライ製ダイナミックマイクを接続することでワイヤレスマイクと有線マイクを同時に使用することもできます。<br>■市販のダイナミックマイク(有線)も接続できる標準的なマイク入力端子(φ6.3mm標準ジャック)を2系統搭載<br>■スピーカーは最大20Wの高出力で屋内環境で約120～150m2程度での使用に最適です<br>■一体型スピーカーなので電源を接続し、マイクを接続するだけで使用できます<br>■外部音声入力を搭載しており、音楽再生も可能。同時にマイク音声出力もできます。カラオケスピーカーとして利用したり、結婚式の2次会やパーティーなどにバックミュージックと共にアナウンスを流したりできます<br>■電源は通常の家庭用コンセントで使用できるAC電源と持ち運び時も使える電池駆動(単3電池6本使用)の2WAYに対応<br>■本体下部には一眼レフカメラ用三脚が取付できる三脚ネジ穴(UNC1/4インチ)を搭載。三脚を取り付けてスタンド付スピーカーとして使用することもできます。<br>■持ち運びに便利なハンドルを装備。付属品やマイク、ケーブルをまとめて収納･保管できる専用バッグを付属。<br><br>■ワイヤレスマイク部<br>■特定小電力無線局ラジオマイク(800MHz帯)規格に適合したワイヤレスマイクです<br>■B型帯域を使用しており10波の中から1波を選択して利用できます<br>■発言者の声色をできるだけ忠実に引き出すワイヤレスダイナミックマイクです<br>スピーカー部<br><b>実用最大出力</b>：20W(10W+10W)<br><b>周波数特性</b>：180Hz～15000Hz<br><b>スピーカー形式</b>：バスレフ式フルレンジ スピーカシステム(防磁設計)<br><b>スピーカーサイズ</b>：3インチ(直径77.8mm)<br><b>ロードインピーダンス</b>：8Ω<br><b>入力端子</b>：φ6.3mm標準ジャック(マイク用)x2、3.5mmステレオミニジャック(外部音声入力用)x1<br><b>電源</b>：AC電源(12V/2A )、電池駆動(単3電池x6本使用)<br><b>外形寸法</b>：W297xD133xH152mm<br><b>重量</b>：約3050g<br><b>同梱品</b>：スピーカー本体x1、ワイヤレスマイクx1、取扱説明書x1、収納用バッグ、ACアダプタx1、取扱説明書x1<br><br>ワイヤレスマイク部<br><b>型式</b>：単一指向性ダイナミックマイク<br><b>アンテナ形式</b>：内蔵アンテナ<br><b>周波数特性</b>：806.250MHz～809.500MHz<br><b>発振方式</b>：水晶制御PLLシンセサイザー<br><b>電波形式</b>：F3E<br><b>トーン信号</b>：32.768kHz<br><b>空中線電力</b>：10mW<br><b>送信周波数安定度</b>：20ppm以下<br><b>不要輻射</b>：2.5μW以下<br><b>基準周波数偏移</b>：±30kHz<br><b>最大周波数偏移</b>：±35kHz<br><b>電源電圧(別売)</b>：DC3V(単3形乾電池x2)<br><b>電池持続時間</b>：約6.5時間(アルカリ電池使用時)<br><b>感度</b>：-76±3dB<br><b>インピーダンス</b>：220Ω<br><b>外形寸法</b>：口径Φ36mmX240mm<br><b>重量</b>：約190g<style type="text/css">
